  }

  render() {
    return(
      <div>
        {/* <NavBar /> */}
        <div id='particles'>
          <Particles
            params={{
              particles: {
                number: {
                  value: 5,
                  density: {
                    enable: true,
                    value_area: 50,
                  }
                },
