                move: {
                  speed: 1.5
                }
              },
            }}
          />
        </div>
        <div id="introBox">
          <h1 id="introLine1">Hello, my name is Mrinal Vig</h1>
          <h1 id="introLine2">and I'm a Full-Stack Web Developer.</h1>
          <div id="checkWork">
            <h1>Check out my work!</h1>
            <img id ='arrow' src={arrow} />
          </div>
        </div>
        <Switch>
            <Route exact path/>
        </Switch>
      </div>
    );
  }
}

export default App;
